import "./styles.css";

export default function App() {
  const [rows, setRows] = useState([]);

  function renderRows(){
    return (
      <div>
        {rows.map((row, index) => (
          <div key={index}>
            <input

              type="text"
              value={row}
              onChange={(e) => {
                const newRows = [...rows];
                newRows[index] = e.target.value;
                setRows(newRows);
              }}
            />
          </div>
        ))}
      </div>
    )
  }
  return (
    <div className="App">
      <h1>React Calculator</h1>

    </div>
  );
}
